MathJax.Localization.addTranslation("cs","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax pou\u017E\xEDv\xE1 k zobrazen\xED matematiky na t\xE9to str\xE1nce webov\xE1 p\xEDsma. T\u011Bm trv\xE1 sta\u017Een\xED n\u011Bjakou dobu, tak\u017Ee str\xE1nka by se vykreslila rychleji, pokud byste si tato matematick\xE1 p\xEDsma nainstalovali p\u0159\xEDmo do syst\xE9mov\xE9 slo\u017Eky p\xEDsem.",imageFonts:"MathJax pou\u017E\xEDv\xE1 m\xEDsto m\xEDstn\xEDch nebo webov\xFDch p\xEDsem obr\xE1zkov\xE9 p\xEDsmo. Proto bude vykreslov\xE1n\xED pomalej\u0161\xED, ne\u017E je obvykl\xE9, a p\u0159i tisku na Va\u0161\xED tisk\xE1rn\u011B mo\u017En\xE1 nebude matematika vykreslena na nejlep\u0161\xED rozli\u0161en\xED.",noFonts:"MathJax nedok\xE1\u017Ee naj\xEDt p\xEDsmo, kter\xFDm by vykreslil matematiku, a obr\xE1zkov\xE1 p\xEDsma nejsou k dispozici, tak\u017Ee se uch\xFDl\xED k b\u011B\u017En\xFDm znak\u016Fm Unicode v nad\u011Bji, \u017Ee je v\xE1\u0161 prohl\xED\u017Ee\u010D dok\xE1\u017Ee zobrazit. N\u011Bkter\xE9 znaky se mo\u017En\xE1 nezobraz\xED spr\xE1vn\u011B, nebo dokonce v\u016Fbec.",webFonts:"V\u011Bt\u0161ina modern\xEDch prohl\xED\u017Ee\u010D\u016F umo\u017E\u0148uje sta\u017Een\xED p\xEDsem p\u0159es web. Aktualizace na nov\u011Bj\u0161\xED verzi prohl\xED\u017Ee\u010De (nebo zm\u011Bna prohl\xED\u017Ee\u010De) by mohla zlep\u0161it zobrazen\xED matematiky na t\xE9to str\xE1nce.",fonts:"MathJax m\u016F\u017Ee pou\u017E\xEDvat bu\u010F [p\xEDsma STIX](%1) nebo [MathJaxov\xE1 TeXov\xE1 p\xEDsma](%2). St\xE1hn\u011Bte a nainstalujte si jedny z nich, abyste si MathJax u\u017Eili l\xE9pe.",STIXPage:"Tato str\xE1nka je vytvo\u0159ena pro pou\u017Eit\xED s [p\xEDsmy STIX](%1). St\xE1hn\u011Bte a nainstalujte si tato p\xEDsma, abyste si l\xE9pe u\u017Eili MathJax.",TeXPage:"Tato str\xE1nka je vytvo\u0159ena pro pou\u017Eit\xED s [MathJaxov\xFDmi TeXov\xFDmi p\xEDsmy](%1). Pro lep\u0161\xED vyu\u017E\xEDv\xE1n\xED MathJaxu si st\xE1hn\u011Bte a nainstalujte tato p\xEDsma."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/cs/FontWarnings.js");
